import React from 'react';
import { Link } from 'react-router-dom';

const Navbar = () => {
  return (
    <nav style={{
      background: '#0a0a0a',
      padding: '15px 30px',
      display: 'flex',
      justifyContent: 'space-between',
      alignItems: 'center',
      borderBottom: '2px solid #ff0000',
      position: 'sticky',
      top: 0,
      zIndex: 1000
    }}>
      <div style={{ display: 'flex', alignItems: 'center', gap: '10px' }}>
        <span style={{ color: '#ff0000', fontSize: '24px' }}>⚡</span>
        <Link to="/" style={{ 
          color: 'white', 
          textDecoration: 'none', 
          fontSize: '20px',
          fontWeight: 'bold'
        }}>
          Lyokorps Tech
        </Link>
      </div>
      
      <div style={{ display: 'flex', gap: '20px' }}>
        <Link 
          to="/pricelist" 
          style={({ isActive }) => ({ 
            color: 'white', 
            textDecoration: 'none',
            padding: '8px 16px',
            borderRadius: '5px',
            transition: 'all 0.3s',
            background: isActive ? '#ff0000' : 'transparent'
          })}
        >
          Прайс-лист
        </Link>
        <Link 
          to="/game" 
          style={({ isActive }) => ({ 
            color: 'white', 
            textDecoration: 'none',
            padding: '8px 16px',
            borderRadius: '5px',
            transition: 'all 0.3s',
            background: isActive ? '#ff0000' : 'transparent'
          })}
        >
          Игра
        </Link>
        <Link 
          to="/contacts" 
          style={({ isActive }) => ({ 
            color: 'white', 
            textDecoration: 'none',
            padding: '8px 16px',
            borderRadius: '5px',
            transition: 'all 0.3s',
            background: isActive ? '#ff0000' : 'transparent'
          })}
        >
          Контакты
        </Link>
      </div>
    </nav>
  );
};

export default Navbar;
